#include<bits/stdc++.h>

using namespace std;

vector<vector<int>> threeSum(vector<int>& nums) {
    
    vector<vector<int>> ans;
    set<vector<int>> a;
    
    if(nums.size()<3){
        return ans;
    }
    
    if(nums.size()==3){
        
        if(nums[0]+nums[1]+nums[2]==0){
            ans.push_back(nums);
        }
        return ans;
    }
    
    unordered_map<int,int> hash;
    
    for(int i = 0;i<nums.size();i++){
        hash[nums[i]] = i;
    }
    
    vector<int> temp;
    
    for(int i = 0;i<nums.size();i++){
        for(int j = 0;j!=i&&j<nums.size();j++){
            
            cout<<"here\n";
            
            if(hash.find((-1)*(nums[i]+nums[j]))!=hash.end()){
                if(hash[(-1)*(nums[i]+nums[j])]!=i&&hash[(-1)*(nums[i]+nums[j])]!=j){
                    temp.push_back(nums[i]);temp.push_back(nums[j]);
                    temp.push_back(nums[hash[(-1)*(nums[i]+nums[j])]]);
                    sort(temp.begin(),temp.end());
                    a.insert(temp);
                    temp.clear();
                }
            }
        }
    }
    
    for(auto itr = a.begin();itr!=a.end();itr++){
        temp = *itr;
        ans.push_back(temp);
        temp.clear();
    }
    
    return ans;
}

